import React from 'react';
import { useLoaderData } from 'react-router-dom';
import Topics from '../Topics/Topics';

const Home = () => {
    const { data } = useLoaderData();

    console.log(data);
    return (
        <div className='my-5'>
            <h3>total topics:{data.length}</h3>
            <div className='d-flex '>
                {
                    data.map(topic => <Topics
                        key={topic.id}
                        topic={topic}
                    ></Topics>)
                }
            </div>
        </div>
    );
};

export default Home;
